$(function(){$(".video-vote a").click(function(e){var o=$("#user-info").val();if(o){var t=$(this).attr("url");$.ajax({url:t,method:"PUT",success:function(e){null==e.err&&($(".video-vote .like-vote-"+e.id).html(e.upvotes),$(".video-vote .unlike-vote-"+e.id).html(e.downvotes))},error:function(){console.log("ajax error")}})}else alert("Please login to vote the video");return e.preventDefault(),!1})});